package three;

import org.util.annotations.SendEveryField;

@SendEveryField
public class StringMessage {
    String msg = "";
    int count = 0;
    long time = 0;

     String msg2 = "";

    public StringMessage() {
    }

    public StringMessage(String msg, int c, boolean isFirst) {
        this.msg = msg;
        this.count = c;
        if (isFirst)
            this.time = System.nanoTime();

    }
}
